import { useNavigate } from "react-router-dom";
import React, { useCallback } from "react";
import background from "../Assets/IMG/volvote.jpg";
import {
  FormUsuarioComponent,
  TableUsuarioComponent,
  ButtonComponents,
} from "../components";
import OfertaTrucha from "./OfertaTrucha";

const usuario1 = [
  {
    nombre: "Jopseph",
    rut: "111111-1",
    IDcompra: "23",
  },
  {
    nombre: "elotrojoseph",
    rut: "22222-2",
    IDcompra: "22",
  },
];

const usuario2 = {
  nombre: "elotrojoseph",
  rut: "22222-2",
  IDcompra: "22",
};

const HomePage = () => {
  const navigate = useNavigate();
  const handleOnClick = useCallback(() => navigate("/Auto", {}, [useNavigate]));
  const ofertaOnClick = useCallback(() =>
    navigate("/OfertaTrucha", {}, [useNavigate])
  );
  return (
    <div>
      <img
        src={background}
        alt="aaa"
        style={{
          position: "absolute",
          zIndex: -1,
          width: "100%",
          height: "220%",
        }}
      />
      <br />
      <FormUsuarioComponent />
      <br />
      <TableUsuarioComponent />
      <br />
      <div class="d-flex justify-content-center">
        <div class="d-flex flex-row-reverse">
          <ButtonComponents
            infoBoton={"Ir a Auto"}
            handleOnClick={handleOnClick}
          />
          <ButtonComponents
            infoBoton={"Ir a OFERTA ÚNICA"}
            handleOnClick={ofertaOnClick}
          />
        </div>
      </div>
    </div>
  );
};
export default HomePage;
